import React from 'react';
import {  Link } from "react-router-dom";
const navbar= () =>{
  return (
  <div>
    <li  className='home'>
      <Link to="/">Home</Link>
    </li>
    <li className='list'>
      <Link to="/list">List</Link>
    </li>
    <li className='login'>
      <Link to="/login">
      Login:
          <input></input>
          <input></input>
          <button></button>
      </Link>
    </li>
  </div>
  );
}
export default navbar;
